import React from 'react';
import { useNavigate } from "react-router-dom";
import './Dashboard.css';

const Dashboard = () => {
    const nav = useNavigate();
    return (
        <div className="container-sm mx-auto mt-5 text-center border border-2 rounded">
            <h1>Dashboard</h1>
            <div className="row">
                <div className="col-sm-4 p-3 bg-primary text-white">
                <div className="row">
                    Message <span className="badge rounded-pill bg-info">5</span>
                </div>
                <div className="row">
                    Sent <span className="badge rounded-pill bg-info">5</span>
                </div>
                <div className="row">
                    Settings <span className="badge rounded-pill bg-info">5</span>
                </div>
                </div>
                <div className="col-sm-8 p-3 bg-dark text-white">.col</div>
            </div>
            <button className="mt-3 btn btn-primary mb-3"
                onClick={() => {
                    nav("/");
                }}>go to Profile</button>
        </div>
    );
}

export default Dashboard;
